script: |
  super -f text -I q11097.spq | sort > q11097.out

inputs:
  - name: q11097.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 NOT BETWEEN + col2 AND ( + col1 + col2 + - CAST ( NULL AS REAL ) * - + ( + + col0 ) );
  - name: tab2

outputs:
  - name: q11097.out
    data: |
